(defn
 raw-resolve-handler
 "Prefer the manually-written version of the handler with name `n`, if it exists, to the automatically generated one"
 [n]
 (try
  (eval (symbol (str "youyesyet" ".routes.manual/" n)))
  (catch
   Exception
   _
   (eval (symbol (str "youyesyet" ".routes.auto/" n))))))

